        function saveNewZones (heroInfo, zonesArray)
        {
            $log.log('[HERO_UTILITIES_FACTORY] Saving new availability zones');

            var newZones = getZonesFullStructure(zonesArray);

            var newHero = _.cloneDeep(heroInfo);
            newHero.numeroRecensioni = undefined;
            newHero.zone = newZones;

            var p = RestService.editHero(heroInfo.id, newHero).then(function(data){
                NotifyService.saveConfirmed();
                $log.log('[HERO_UTILITIES_FACTORY] New zones saved');
            }, function(){
                NotifyService.saveConfirmed(true);
                $log.error('[HERO_UTILITIES_FACTORY] Error while saving zones');
            });
        }

        function getZonesArray (zones)
        {
            var output = [];
            zones.forEach(function(zona){
                output.push(zona.id);
            });
            return output;
        }

        function getZonesFullStructure (zones)
        {
            var newZones = [];
            zones.forEach(function(area){
                newZones.push({id:area});
            });
            return newZones;
        }

        return {
            getZonesArray: getZonesArray,
            getZonesFullStructure: getZonesFullStructure,
            saveNewZones: saveNewZones,
            citiesZone: citiesZone
        }

